// src/components/Sidebar.jsx
import React from 'react';
import '../assets/styles.css';

const Sidebar = () => {
  return (
    <aside className="sidebar">
      <h2>Menu</h2>
      <ul className="sidebar-links">
        <li>Dashboard</li>
        <li>Stocks</li>
        <li>Portfolio</li>
        <li>Settings</li>
      </ul>
    </aside>
  );
};

export default Sidebar;
